import React from "react";

const Header = () => {
  return (
    <>
      <nav>
        <h1>PRAKRUTHI MANJUNATHA</h1>

        <a href="https://drive.google.com/file/d/1XBYHI7W9LuK_PC1m7jSfJwxQ4sEPYP_o/view?usp=sharing">
          Resume
        </a>
      </nav>
    </>
  );
};

export default Header;
